import "../css/ResultPage.css";
import { useLocation, useNavigate } from "react-router-dom";

export default function ResultPage() {
  const location = useLocation();
  const navigate = useNavigate();

  const { location: userLocation, styles, request } = location.state || {};

  return (
    <div className="result-container">
      <h1 className="result-title">오늘의 추천 OOTD</h1>
      <p className="result-subtitle">{userLocation} 날씨와 요청사항을 반영한 결과</p>

      <div className="result-card">
        <p><strong>선택한 위치:</strong> {userLocation}</p>
        <p><strong>스타일:</strong> {styles?.join(", ")}</p>
        <p><strong>요청사항:</strong> {request}</p>

        <div className="result-image">
          <img src="https://via.placeholder.com/300x400?text=추천+코디" alt="추천 코디" />
        </div>

        <button className="back-btn" onClick={() => navigate("/")}>
          다시 추천받기
        </button>
      </div>
    </div>
  );
}
